import { useEffect, useState } from 'react'
import Nav from './Nav.jsx';
import './App.css';

function App() {
  const [characters, setCharacters] = useState([])

  useEffect(() => {
    apiCall()
  }, [])

  function apiCall() {
    fetch(" https://rickandmortyapi.com/api/character")
      .then((res) => res.json())
      .then((data) => setCharacters(data))
  }
  return (
    <div className="App">
      <Nav />
    </div>
  );
}

export default App;
